function playsound(noteNumber){
    var soundId = 'sound' + noteNumber;
    var keyId = 'key' + noteNumber;
    var key = document.getElementById(keyId);
    var audio = null;
    if(sound){
        if(sound[soundId]){
            audio = new Audio(sound[soundId]);
            audio.play();
        }
    }
    if(key){
        key.style.backgroundColor = '#000';
        setTimeout('reset(' + noteNumber + ')', 100);
    }
}
function reset(noteNumber){
    var keyId = 'key' + noteNumber;
    var key = document.getElementById(keyId);
    key.style.backgroundColor = '#fff';
}
